        const char *start = cursor;
        while (*cursor && !is_space(*cursor))
        {
            ++cursor;
        }
        size_t len = (size_t)(cursor - start);
        char *token = (char *)malloc(len + 1);
        if (!token)
        {
            shell_free_argv(argv, argc);
            return NULL;
        }
        memcpy(token, start, len);
        token[len] = '\0';
        if (argc >= capacity)
        {
            size_t new_capacity = capacity * 2;
            char **new_argv = (char **)realloc(argv, new_capacity * sizeof(char *));
            if (!new_argv)
            {
                free(token);
                shell_free_argv(argv, argc);
                return NULL;
            }
            argv = new_argv;
            capacity = new_capacity;
        }
        argv[argc++] = token;
    }

