}

static vfs_node_t *shell_resolve_command(shell_state_t *shell, const char *cmd)
{
    if (!cmd || *cmd == '\0')
    {
        return NULL;
    }
    for (const char *p = cmd; *p; ++p)
    {
        if (*p == '/')
        {
            return vfs_resolve(shell ? shell->cwd : vfs_root(), cmd);
        }
    }

    size_t name_len = strlen(cmd);
    size_t total = name_len + 6;
    char *path = (char *)malloc(total);
    if (!path)
