        return NULL;
    }
    memcpy(path, "/bin/", 5);
    memcpy(path + 5, cmd, name_len + 1);
    vfs_node_t *node = vfs_resolve(vfs_root(), path);
    free(path);
    return node;
}

static int shell_prepare_redirect_fd(shell_state_t *shell, const char *path)
{
