        free(ctx);
    }
    return fd;
}

static char *shell_format_exec_error(const char *message)
{
    if (!message)
    {
        return shell_duplicate_string("Error: exec failed\n");
    }
    size_t len = strlen(message);
    const char prefix[] = "Error: ";
    size_t total = sizeof(prefix) - 1 + len + 2;
    char *buffer = (char *)malloc(total);
    if (!buffer)
    {
        return shell_duplicate_string("Error: exec failed\n");
    }
    memcpy(buffer, prefix, sizeof(prefix) - 1);
    memcpy(buffer + sizeof(prefix) - 1, message, len);
    buffer[sizeof(prefix) - 1 + len] = '\n';
    buffer[sizeof(prefix) - 1 + len + 1] = '\0';
    return buffer;
}

static bool shell_try_execute_external(shell_state_t *shell,
